import React, { Component } from 'react'

export default class Card extends Component {
  render() {
    return (
      <div>
        { this.props.data.map((x) => <h4>{x.name}</h4>)
        }
      </div>
    )
  }
}

const Hospital = (props) => <h4>{props.name.name}</h4>
